import "./Sort.css";

export default function Sort() {
  return (
    <div>
      <form>
        <select name="sort" id="sort">
          <option value="Read">Read</option>
          <option value="Unread"></option>
          <option value="Page Count"></option>
        </select>
      </form>
    </div>
  );
}
